    <style>
body {
    font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
    margin: 0;
    padding: 0;
    display: flex;
    justify-content: center;
    align-items: center;
    height: 100vh;
    background-color: #f9f9f9;
}

.flex-caes {

    display: flex;
    align-items: center;
    width: 100%;
}
.img-izq {
    width: 60%;
}


.img-izq img {
    height: 100vh;
    object-fit: cover;
    width: 100%;
}
.container {
    text-align: center;
    width: 40%;
}
.container-two {
    width: 90%;
    margin: auto;


}

.logo {
    max-width: 250px;
    height: auto;
    width: 100%;    
    padding-bottom: 30px;

}

.options {
    display: flex;
    flex-direction: column;
    gap: 15px;
    max-width: 300px;
    margin: 0 auto;
    max-width: 100%;
    flex-direction: row;
    margin: auto;
    align-items: center;
    justify-content: center;
}

.btn {
    padding: 15px;
    border: none;
    border-radius: 8px;
    font-size: 1.2rem;
    cursor: pointer;
    text-decoration: none;
    transition: background-color 0.3s ease;
    display: block;
    width: fit-content;
}

.btn:hover {
    filter: brightness(0.9);
}

.consultar {
    background-color: #3498db;
    color: white;
}

.calcular {
    background-color: #2ecc71;
    color: white;
}

.registrarse {
    background-color: #e74c3c;
    color: white;
}


/* */

.button svg {
    max-width: 30px;
    width: 100%;
    max-height: 30px;

}

.button {
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 5px 10px;
  gap: 5px;
  background-color: #007ACC;
  outline: 3px #007ACC solid;
  outline-offset: -3px;
  border-radius: 5px;
  border: none;
  cursor: pointer;
  transition: 400ms;
  width: 160px;
}

.button .text {
  color: white;
  font-weight: 700;
  font-size: 12px;
  transition: 400ms;
}

.button svg path {
  transition: 400ms;
}

.button:hover {
  background-color: transparent;
}

.button:hover .text {
  color: #ffffff;
}

.button:hover svg path {
  fill: #ffffff;
}
.button.csls{
    background-color: #357f26;
    outline: 3px #357f26 solid;
}
.button.calccred{
    background-color: #e49c2c;
    outline: 3px #e49c2c solid;
}
.button.regdig{
    background-color: #327ef9;
    outline: 3px #327ef9 solid;
}

a{
    text-decoration: none;

}
/* */

@media screen and (min-width: 480px) and (max-width: 1240px) {
    .options {
        flex-direction: column;

    }
    

}
@media (max-width: 480px) {
    .btn {
        padding: 12px;
        font-size: 1rem;
    }
    .img-izq {
        display: none;
    }
    .container {
        width: 100%;
    }
    .options {
        flex-direction: column;

    }
}
        </style>
</head>
